function manualSwap() public {
    /*
        The original bytecode performs an on-demand token-to-ETH swap
        and then distributes the received ETH between two fee wallets
        according to the proportions stored in `_taxShare1` and
        `_taxShare2`.  
        All external calls have been preserved; variable names are
        upgraded for clarity only.
    */

    // 1. Grab the contract’s current token balance.
    uint256 tokenBalance = balanceOf(address(this));
    if (tokenBalance == 0) {
        // Nothing to swap – return early exactly as the EVM would
        // by simply falling through without executing any further
        // logic.
        return;
    }

    // 2. Give the router permission to spend the tokens.
    _approve(address(this), address(uniswapV2Router), tokenBalance);

    // 3. Build the swap path: This token -> WETH.
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = uniswapV2Router.WETH();

    // 4. Execute the swap.
    uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
        tokenBalance,
        0,                      // accept any amount of ETH
        path,
        address(this),          // ETH is sent back to this contract
        block.timestamp
    );

    // 5. Fetch the newly-acquired ETH balance.
    uint256 ethBalance = address(this).balance;
    if (ethBalance == 0) {
        return; // No ETH to distribute.
    }

    // 6. Calculate distribution amounts.
    uint256 totalShare = _taxShare1 + _taxShare2;
    if (totalShare == 0) {
        revert("Decompiler artifact");
    }

    // Send the proportional shares.
    _taxWallet1.transfer((ethBalance * _taxShare1) / totalShare);
    _taxWallet2.transfer(address(this).balance); // send the remainder
}

